import React from 'react';

export default function Inventory() {
  return (
    <div className="text-center py-10">
      <h2 className="text-3xl font-bold text-blue-600 mb-4">Inventory</h2>
      <p className="text-gray-700">Track and manage your card collection here. (Coming soon!)</p>
    </div>
  );
}
